import React, { Component } from 'react';
import dubrovnik from '../assets/art/dubrovnik.jpg';
import dubrovnikV2 from '../assets/art/dubrovnik-2.jpg';
import ArtDisplay from '../Components/ArtDisplay';

const Text = <span>
              Roofs of Dubrovnik
            </span>

class Dubrovnik extends Component {

  render() {
    return(
      <ArtDisplay title='Roofs of Dubrovnik' client='Personal Work' year='2018' technique='Ink Paper' text={Text}>
        <img className="block-image mx-auto" src={dubrovnik} alt="d1"></img>
        <img className="block-image mx-auto " src={dubrovnikV2} alt="d2"></img>
      </ArtDisplay>
    );
  }
}

export default Dubrovnik;
